INSERT INTO `category_translations` (`id`, `locale`, `category_id`, `name`, `description`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(15, 'en', 12, 'Linens & Table Runners', '<p>Table linens&nbsp;<em>help to convey the theme and level of service at your restaurant or event</em>&nbsp;while protecting tables and creating inviting visual appeal.</p>', NULL, NULL, NULL),
(16, 'en', 13, 'Kitchenware', '<p>Kitchenware&nbsp;<em>are the tools, utensils, appliances, dishes, and cookware used in food preparation, or the serving of food</em>.</p>', NULL, NULL, NULL),
(17, 'en', 14, 'Themed Party Supplies', '<p>Buy unforgettable party ideas in our online store, from party&nbsp;<em>decorations</em>&nbsp;&amp; supplies, to balloons, to personalised banners &amp; party kits!</p>', NULL, NULL, NULL),
(18, 'en', 15, 'Lighting', '<p>Lighting or illumination is the deliberate use of light to achieve practical or aesthetic effects. Lighting includes the use of both artificial light sources like lamps and light fixtures, as well as natural illumination by capturing daylight.&nbsp;</p>', NULL, NULL, NULL),
(19, 'en', 16, 'Wedding Dresses', '<p>A wedding dress or bridal gown&nbsp;<em>is the dress worn by the bride during a wedding ceremony</em>. The color, style and ceremonial importance of the gown can depend&nbsp;...</p>', NULL, NULL, NULL),
(20, 'en', 17, 'Bridal Accessories', '<p><em>A veil, headpiece, or hair accessories to complement your gown</em>&nbsp;&middot; Wedding shoes that are comfortable enough to dance the night away &middot; A clutch bag for wedding day.</p>', 'Meta Tag Title', 'Meta Tag Keywords', '<p>Meta Tag Description</p>'),
(45, 'en', 42, 'Themed Disposables', NULL, NULL, NULL, NULL),
(46, 'en', 43, 'Guest Accessories & Party Favors', NULL, NULL, NULL, NULL),
(47, 'en', 44, 'Furniture', NULL, NULL, NULL, NULL);
