INSERT INTO `email_templates` (`id`, `template_key`, `name`, `subject`, `template`, `token`, `email`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'registration-mail-send-to-admin', 'Registration Mail Send To Admin', 'User is register in our system', '<p>Hello <strong>Admin</strong>,<br />\r\n[FIRST_NAME] [LAST_NAME] is registered in the system.</p>\r\n\r\n<p>Please find below the user details:</p>\r\n\r\n<p>First Name: [FIRST_NAME]</p>\r\n\r\n<p>Last Name: [LAST_NAME]</p>\r\n\r\n<p>Email: [EMAIL]</p>\r\n\r\n<p>Phone: [PHONE]</p>', '[FIRST_NAME],[LAST_NAME],[EMAIL],[PHONE]', 'test@galitein.co.in', 1, '2022-11-01 18:23:52', '2022-12-02 05:59:02', NULL),
(2, 'registration-mail-send-to-user', 'Registration Mail Send To User', 'You are successfully registered in [SITE_NAME]', '<p>Hi,</p>\r\n\r\n<p>Thank you for your registration on [SITE_NAME] portal.</p>\r\n\r\n<p>Please activate your account and start using it.</p>\r\n\r\n<p>[TOKEN]</p>\r\n\r\n<p>Regards,<br />\r\nAfter My Events</p>', '[FIRST_NAME],[LAST_NAME],[TOKEN],[SITE_NAME]', 'test@galitein.co.in', 1, '2022-11-01 18:23:52', '2022-12-02 05:58:59', NULL),
(3, 'forgot-password-mail-send-to-user', 'Forgot Password Mail Send To User', 'Reset Password Notification', '<p>Hi [USER_NAME],</p>\r\n\r\n<p>Please reset your password for After My Event portal by clicking the link below:</p>\r\n\r\n<p>[RESET_PASSWORD_BUTTON]</p>\r\n\r\n<p>Regards,<br />\r\nAfter My Events</p>', '[FIRST_NAME],[LAST_NAME],[USER_NAME],[RESET_PASSWORD_BUTTON]\r\n', NULL, 1, '2022-11-01 18:23:52', '2022-12-02 06:02:55', NULL),
(4, 'mark-inappropriate-message-mail-send-to-admin', 'Mark Inappropriate Message Mail Send To Admin', 'The message is marked as Inappropriate by the user in the system', '<p>Hello <strong>Admin</strong>,</p>\r\n\r\n<p>[FROM_USER_NAME] has been marked as Inappropriate [TO_USER_NAME] below the message.</p>\r\n\r\n<blockquote>\r\n<p>[MESSAGE]</p>\r\n</blockquote>', '[FROM_USER_NAME],[TO_USER_NAME],[MESSAGE]', NULL, 1, '2022-11-01 18:23:52', '2022-12-02 08:47:50', NULL),
(5, 'mark-irrelevancy-listing-mail-send-to-admin', 'Mark Irrelevancy Listing Mail Send To Admin', 'The product is marked as Irrelevancy by the user in the system', '<p>Hello <strong>Admin</strong>,</p>\r\n<p>[FROM_USER_NAME] has been marked as Irrelevancy [PRODUCT_NAME] product.</p>\r\n<p>[REASON]</p>', '[FROM_USER_NAME],[PRODUCT_NAME],[REASON]', NULL, 1, '2022-11-01 18:23:52', '2022-11-01 13:55:15', NULL),
(6, 'subscription-mail-send-to-admin', 'Subscription Mail Send To Admin', 'The user has been subscribed to the system', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:right\">[USER_ADDRESS]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:right\">Date: [SUBSCRIPTION_DATE]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Hello <strong>Admin</strong>,</p>\r\n\r\n<p>[FIRST_NAME] [LAST_NAME] has been subscribed to the system.</p>\r\n\r\n<p>Plan Info</p>\r\n\r\n<table border=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Name</th>\r\n			<td>[PLAN_NAME]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Description</th>\r\n			<td>[PLAN_DESCRIPTION]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Subscription Info</p>\r\n\r\n<table border=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<th>SUBSCRIPTION ID</th>\r\n			<td>[SUBSCRIPTION_ID]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>INVOICE ID</th>\r\n			<td>[INVOICE_ID]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>START DATE</th>\r\n			<td>[SUBSCRIPTION_START_DATE]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>END DATE</th>\r\n			<td>[SUBSCRIPTION_END_DATE]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>TOTAL</th>\r\n			<td>[SUBSCRIPTION_AMOUNT]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '[FIRST_NAME], [LAST_NAME], [SUBSCRIPTION_DETAIL]', NULL, 1, '2022-11-01 18:23:52', '2022-12-02 07:31:53', NULL),
(7, 'subscription-mail-send-to-user', 'Subscription Mail Send To User', 'Thank you for subscribing to [SITE_NAME]', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:right\">[USER_ADDRESS]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:right\">Date: [SUBSCRIPTION_DATE]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Dear [FIRST_NAME] [LAST_NAME] ([USER_EMAIL]),</strong></p>\r\n\r\n<p>Here is your subscription details. We thank you for your purchase.</p>\r\n\r\n<p>Plan Info</p>\r\n\r\n<table border=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Name</th>\r\n			<td>[PLAN_NAME]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Description</th>\r\n			<td>[PLAN_DESCRIPTION]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Subscription Info</p>\r\n\r\n<table border=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<th>SUBSCRIPTION ID</th>\r\n			<td>[SUBSCRIPTION_ID]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>INVOICE ID</th>\r\n			<td>[INVOICE_ID]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>START DATE</th>\r\n			<td>[SUBSCRIPTION_START_DATE]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>END DATE</th>\r\n			<td>[SUBSCRIPTION_END_DATE]</td>\r\n		</tr>\r\n		<tr>\r\n			<th>TOTAL</th>\r\n			<td>[SUBSCRIPTION_AMOUNT]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '[FIRST_NAME], [LAST_NAME], [SITE_NAME]', NULL, 1, '2022-11-01 18:23:52', '2022-12-02 07:31:47', NULL),
