(5, 'en', 5, 'New Products', '<p>tets</p>', NULL, NULL, NULL, NULL),
(6, 'en', 6, 'SODA (COKE, SPRITE) & SOFT DRINKS', '<p><em>Sprite</em>&nbsp;is a clear lime&nbsp;<em>drink</em>&nbsp;truly meant to quench your thirst &amp; refresh you since 1999. Now, don&#39;t confuse &#39;thirst&#39; with anything else under the sky!</p>', NULL, NULL, NULL, NULL),
(7, 'en', 7, 'MILK', '<p>Dairy products or milk products, also known as lacticinia, are food products made from milk. The most common dairy animals are cow, water buffalo, nanny goat, and ewe. Dairy products include common grocery store food items in the Western world such as yogurt, cheese and butter.&nbsp;</p>', NULL, NULL, NULL, NULL),
(8, 'en', 8, 'BREAD', '<p>Bread Products. FROZEN/COOLED DOUGH*. Yeast damage and protein denaturation caused by storing dough in a refrigerator or freezer will negatively influence&nbsp;...</p>', NULL, NULL, NULL, NULL),
(9, 'en', 9, 'CANDY BARS', '<p>From ALMOND JOY&nbsp;<em>Candy</em>&nbsp;to ZAGNUT&nbsp;<em>Bars</em>, search and shop your favorite Hershey&nbsp;<em>products</em>&nbsp;and&nbsp;<em>candy</em>&nbsp;brands on Hersheyland.</p>', NULL, NULL, NULL, NULL),
(10, 'en', 10, 'Figurines', '<p><em>Figurines</em>&nbsp;are basically sculptures, idols, or models that are made to look like a variety of different subjects. These subjects may be abstract or could look&nbsp;</p>', NULL, NULL, NULL, NULL),
(11, 'en', 11, 'Votives & Candle Holders', 'By shopping with us you contribute to world-leading research in environmental protection. Discover a world of beautiful colours and timeless prints from Svenskt Tenn. Swedish design. Sustainability in focus. Quality craftsmanship. Personal service. Since 1924.', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', 'Meta Tag Title In publishing and graphic design,', 'Meta Tag Keywords In publishing and graphic design,', 'Meta Tag Description publishing and graphic design,'),
(12, 'en', 12, 'Mirrors', '<p><em>Mirrors</em>&nbsp;are really versatile - they brighten up a room, add to your decor and you can check your look in them. Discover our wide range, from dressing table&nbsp;.</p>', NULL, NULL, NULL, NULL),
(13, 'en', 13, 'Baking dish', '<p>The term &ldquo;baking dish&rdquo; typically refers to&nbsp;<strong>an oven-safe rectangular dish made out of glass, stoneware or porcelain</strong>. Baking dishes also come in oval and square shapes, and they vary in size and depth. Glass, stoneware and porcelain don&#39;t conduct heat very well, so they take a while to heat up.1111111</p>', NULL, '<p>Vijay</p>', '<p>123</p>', '<p>123456</p>'),
(14, 'en', 14, 'Baking tray', '<p>chiefly British. :&nbsp;<strong>a rectangular metal sheet with a rolled edge used for baking</strong>&nbsp;: baking sheet Lay the dough sticks on a baking tray lined with nonstick paper and bake for 35&ndash;40 minutes, until golden and crisp.&mdash;</p>', NULL, 'asdadasdsad', 'asdsadsadas', 'asdsadasdas'),
(15, 'en', 15, 'Cake pan', '<p>A cake pan is&nbsp;<strong>a metal container that you bake a cake in</strong>.</p>', NULL, 'Cake pan', 'Cake pan Tag Keywords', 'Cake pan Tag Descriptions'),
(16, 'en', 16, 'Party Supplies', '<p>Party supplies&nbsp;are&nbsp;<strong>specialty items that include everything from tableware to balloons and banners</strong>. It is important to find party supplies that work together to create a common theme. Party supplies can be coordinated by color or motif, designed to fit the venue of the event.</p>', '<p>tewt</p>', '<p>Patel Vishal</p>', '<p>Patel  Vishal</p> Meta Tag Keywords', '<p>Patel   Vishal</p> Meta Tag Descriptions'),
(17, 'en', 17, 'Decorations', '<p>To decorate&nbsp;<em>is to spiff something up, making it more colorful and attractive</em>, like hanging streamers in a room or ornaments on a tree. Decorations are things&nbsp;...</p>', NULL, NULL, NULL, NULL),
(18, 'en', 18, 'Balloons', '<p>balloon,&nbsp;<strong>large airtight bag filled with hot air or a lighter-than-air gas, such as helium or hydrogen, to provide buoyancy so that it will rise and float in the atmosphere</strong>.</p>', '<p>Testing Condition Descrptions.</p>', NULL, NULL, NULL),
(19, 'en', 19, 'Christmas lighting', '<p>Christmas lights (also called twinkle lights, holiday lights, mini lights or fairy lights), that are&nbsp;<strong>strands of electric lights used to decorate homes, public/commercial buildings and Christmas trees during the Christmas season</strong>&nbsp;are amongst the most recognized forms of Christmas lighting.</p>', NULL, NULL, NULL, NULL),
(20, 'en', 20, 'Backlighting', '<p>In lighting design, backlighting is&nbsp;<strong>the process of illuminating the subject from the back</strong>. In other words, the lighting instrument and the viewer face each other, with the subject in between. This creates a glowing effect on the edges of the subject, while other areas are darker.</p>', NULL, NULL, NULL, NULL),
(21, 'en', 21, 'Bicycle lighting', 'Bicycle lighting is illumination attached to bicycles whose purpose above all is, along with reflectors, to improve the visibility of the bicycle and its rider to other road users under circumstances of poor ambient illumination.', NULL, NULL, NULL, NULL),
(22, 'en', 22, 'Ball Gown', 'A ball gown, ballgown or gown is&nbsp;a type of evening gown worn to a ball or a formal event. Most versions are cut off the shoulder with a low d&eacute;colletage,&nbsp;...', NULL, NULL, NULL, NULL),
(23, 'en', 23, 'Trumpet', '1a :&nbsp;a wind instrument consisting of a conical or cylindrical usually metal tube, a cup-shaped mouthpiece, and a flared bell&nbsp;specifically : a valved brass instrument having a cylindrical tube with two turns and a usual range from F sharp below middle C upward for 2&sup1;/₂ octaves.', NULL, NULL, NULL, NULL),
(24, 'en', 24, 'Sheath', '<p>The slim shape of a sheath dress is perfect for brides with a petite figure. This formfitting style can also be worn in nearly any type of fabric such as lace, satin or even some embellished beading. Its shape is also quite easy to move around in so you won&rsquo;t be stuck feeling constricted all night long.</p>', NULL, NULL, NULL, NULL),
(25, 'en', 25, 'Veil', '<p>A veil is an article of clothing or hanging cloth that is intended to cover some part of the head or face, or an object of some significance. Veiling has a long history in European, Asian, and African societies. The practice has been prominent in different forms in Judaism, Christianity, and Islam.</p>', NULL, NULL, NULL, NULL),
(50, 'en', 50, 'Jane Velvet Accent Chair in Rust Colour', '<p>Buy&nbsp;Jane Velvet Accent Chair in Rust Colour&nbsp;online at Best Price. Shop Velvet in Rust color from amazing designs. Avail discounts upto 50% on Accent Chair&nbsp;...</p>', NULL, NULL, NULL, NULL),
(51, 'en', 51, 'settee', 'A couch, also known as a sofa, settee, or chesterfield, is a cushioned item of furniture for seating multiple people. It is commonly found in the form of a bench, with upholstered armrests, and often fitted with springs and tailored cushion and pillows.', NULL, NULL, NULL, NULL),
(52, 'en', 52, 'Table', '<p>A table is an item of furniture with a raised flat top and is supported most commonly by 1 or 4 legs, used as a surface for working at, eating from or on which to place things.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL),
(53, 'en', 53, 'Coffee table', 'A coffee table is a low table designed to be placed in a sitting area for convenient support of beverages, remote controls, magazines, books, decorative objects, and other small items.', NULL, NULL, NULL, NULL),
(54, 'en', 54, 'Desk', '<p>A desk or bureau is a piece of furniture with a flat table-style work surface used in a school, office, home or the like for academic, professional or domestic activities such as reading, writing, or using equipment such as a computer</p>', NULL, 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content.', 'Produst,Furniture,Desk', 'text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available.'),
(55, 'en', 55, 'Measuring cup', '<p>A measuring cup is a kitchen utensil used primarily to measure the volume of liquid or bulk solid cooking ingredients such as flour and sugar, especially for volumes from about 50 mL upwards. Measuring cups are also used to measure washing powder, liquid detergents and bleach for clothes washing.</p>', NULL, NULL, NULL, NULL),
(56, 'en', 56, 'Tongs', '<p>Tongs are a type of tool used to grip and lift objects instead of holding them directly with hands. There are many forms of tongs adapted to their specific use. The first pair of tongs belongs to the Egyptians</p>', NULL, 'product title', 'product keyword', '<p>description</p>'),
(57, 'en', 57, 'Grater', 'A grater, also known as a shredder, is a kitchen utensil used to grate foods into fine pieces. The modern grater was invented by Fran&ccedil;ois Boullier in the 1540s, originally to grate cheese.', NULL, NULL, NULL, NULL),
(58, 'en', 58, 'Frying pan', '<p>A frying pan, frypan, or skillet is a flat-bottomed pan used for frying, searing, and browning foods. It is typically 20 to 30 cm in diameter with relatively low sides that flare outwards, a long handle, and no lid. Larger pans may have a small grab handle opposite the main handle.</p>', NULL, NULL, NULL, NULL),
(59, 'en', 59, 'Knife', '<p>A knife is a tool or weapon with a cutting edge or blade, usually attached to a handle or hilt. One of the earliest tools used by humanity, knives appeared at least 2.5 million years ago, as evidenced by the Oldowan tools.</p>', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', 'This is a Knife product', 'This is a Knife product keywords for tetsing. This is a Knife product keywords for tetsing', 'This is a Knife product description for tetsing purpose.This is a Knife product description for tetsing purpose. This is a Knife product description for tetsing purpose.This is a Knife product description for tetsing purpose.This is a Knife product description for tetsing purpose.'),
